func ValidateNotificationResponseBody(body *NotificationResponseBody) (err error) {
	if body.ID == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("id", "body"))
	}
	if body.ProjectID == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("projectId", "body"))
	}
	if body.Type == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("type", "body"))
	}
	if body.Level == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("level", "body"))
	}
	if body.Title == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("title", "body"))
	}
	if body.CreatedAt == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("createdAt", "body"))
	}
	if body.ID != nil {
		err = goa.MergeErrors(err, goa.ValidateFormat("body.id", *body.ID, goa.FormatUUID))
	}
	if body.ProjectID != nil {
		err = goa.MergeErrors(err, goa.ValidateFormat("body.projectId", *body.ProjectID, goa.FormatUUID))
	}
	if body.Type != nil {
		if !(*body.Type == "system" || *body.Type == "user_action") {
			err = goa.MergeErrors(err, goa.InvalidEnumValueError("body.type", *body.Type, []any{"system", "user_action"}))
		}
	}
	if body.Level != nil {
		if !(*body.Level == "info" || *body.Level == "success" || *body.Level == "warning" || *body.Level == "error") {
			err = goa.MergeErrors(err, goa.InvalidEnumValueError("body.level", *body.Level, []any{"info", "success", "warning", "error"}))
		}
	}
	if body.ArchivedAt != nil {
		err = goa.MergeErrors(err, goa.ValidateFormat("body.archivedAt", *body.ArchivedAt, goa.FormatDateTime))
	}
	if body.CreatedAt != nil {
		err = goa.MergeErrors(err, goa.ValidateFormat("body.createdAt", *body.CreatedAt, goa.FormatDateTime))
	}
	return
}
